import styled from 'styled-components'
import ListOfOptions from '../src/components/list-of-options'
import ListOfCards from '../src/components/list-of-cards'

const Container = styled.div`
  background-color: #0e0e10;
  display: flex;
  min-height: 100vh;
  margin: 24px;
`

const Home = () => {
  return (
    <>
      <Container>
        <ListOfOptions />
        <ListOfCards />
      </Container>
    </>
  )
}

export default Home
